import React from "react"
import './Home.css'

function Home(){
    return(
        <>
        <div className="home-main">
            <a href="/plants" className="home-inner plants"></a>
            <a href="/recipes" className="home-inner recipes"></a>
            <a href="/projects" className="home-inner projects"></a>
        </div>
        </>
    );
}

export default Home;
